import React from 'react'
import '../css/TodoCounter.css';

function TodoCounter({ totalTodos, completed }) {

  return (
    <h2 className='TodoCounter'>{`Has completado ${completed} de ${totalTodos} TODOs`}</h2>
  )
}

export { TodoCounter }
